import React from "react";
import TaskForm from "./TaskForm";
import Header from "./Header.js";
import TaskListContainer from "./TaskListContainer";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Header />
        <TaskForm />
        <TaskListContainer />
      </div>
    );
  }
}

export default App;
